import Navbar from "components/Navbar"
import {Switch,Routes} from 'react-router-dom';
import Home from "views/Home"

function Content(){

	return(
            
       <main className="flex-auto">
       <Navbar />
       <Switch>
              <Routes path="/">
                 <Home />
              </Routes>
       </Switch>
  </main>
          

	)
}

export default Content
